const reducerDatabank = (
  state = {
    userInfo: {},
    produtos: {},
    orcamentosPrime: {},
    orcamentosVnda: {},
  },
  action
) => {
  switch (action.type) {
    case "UPDATEDATABANK":
      return { ...state, ...action.input };

    default:
      return state;
  }
};
export default reducerDatabank;
